import React, { Component } from 'react'
import GridSystem from './component/GridSystem.js';
import DrawArrows from './component/DrawArrows.js';
import Xarrow from "react-xarrows";
import {Image} from "react-bootstrap"


export const ViewerNetworkVisualization = (props) => {

    BuildDataForViewerNetworkVisualization = (pathes, optionMatch) =>{

        if( pathes!= null && optionMatch!=null){
            
            const gridSystemPathesIndex = [ ["12","6","2","1"] , ["13","8","9","3"] , ["18","23","24","29"] , ["17","22","21","26"] ]
             
            const gridSystemPathesData = Array.apply(null, Array(30)).map(function () {})
    
            let z = 0
    
            for( let i = 0 ;i < pathes.length && i<=3; i++ ){
                for(let j = 0 ;j < pathes[j].length; j++){
                                       
                    if( j == (pathes[j].length -1) ){
                        gridSystemPathesData[z++] = {next: gridSystemPathesIndex[i][j+1]  ,  index: gridSystemPathesIndex[i][j],  content: pathes[i][j].image[0].content}
                        gridSystemPathesData[z++] = {next: null  ,  index: gridSystemPathesIndex[i][j+1],  content: props.optionMatch.image[0].content}
                    }
                    else{
                        gridSystemPathesData[z++] = {next: gridSystemPathesIndex[i][j+1]  ,  index: gridSystemPathesIndex[i][j],  content: pathes[i][j].image[0].content }  
                    }
                }
            }
            
            return gridSystemPathesData;
        }
        else{
            return null
        }       
    }

    return <>

             <>

                 {/* emptyOrfull={this.state.arr} */}
                 {/* BuildPathesForGridSystem(props.pathes,props.optionMatch) */}
                 <GridSystem colCount={5} rowcount={6} gridSystemPathesData={BuildDataForViewerNetworkVisualization()} >          
                     {/* {this.state.conection.map(c => <Image src={c.image} roundedCircle className="grid-image" id={c.index} /> )}                                              */}
                 </GridSystem>
            
                {/* <DrawArrows>
                     {this.state.conection}
                 </DrawArrows>  */}
                
             </>

     </>

}
 
export default ViewerNetworkVisualization
